import React, { Component } from 'react';
import { Button, Form } from "react-bootstrap";

class Searchbar extends Component {

    constructor(props) {
        super(props);
        this.state = {
            initialState: "Search for businesses in Indianapolis...",
            currentText: " "
        }
    }

    changeText(currentText) {
        this.setState({currentText});
        //console.log({currentText});
    }

    render() {
        return (
            // <div class="search-box">
            //     {/*<Form>*/}
            //     {/*    <input type="text" placeholder={this.state.initialState} onChange={this.changeText.bind(this, 'currentText')} />*/}
            //     {/*    <Button onClick={this.changeText.bind(this, 'currentText')}>Search</Button>*/}
            //     {/*</Form>*/}
            //
            // </div>
            <form>
                <div className="form-group">
                    <label htmlFor="exampleFormControlInput1">Email address</label>
                    <input type="email" className="form-control" id="exampleFormControlInput1"
                           placeholder="name@example.com"/>
                </div>
                <div className="form-group">
                    <label htmlFor="exampleFormControlSelect1">Example select</label>
                    <select className="form-control" id="exampleFormControlSelect1">
                        <option>1</option>
                        <option>2</option>
                        <option>3</option>
                        <option>4</option>
                        <option>5</option>
                    </select>
                </div>
                <div className="form-group">
                    <label htmlFor="exampleFormControlSelect2">Example multiple select</label>
                    <select multiple className="form-control" id="exampleFormControlSelect2">
                        <option>1</option>
                        <option>2</option>
                        <option>3</option>
                        <option>4</option>
                        <option>5</option>
                    </select>
                </div>
                <div className="form-group">
                    <label htmlFor="exampleFormControlTextarea1">Example textarea</label>
                    <textarea className="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
                </div>
            </form>
        );
    }

}

export default Searchbar;
